// SPDX-License-Identifier: GPL-3.0
pragma solidity ^0.8.0;
import "@openzeppelin/contracts/access/Ownable.sol";

interface ERC20 {
    function transferFrom(address from, address to, uint tokens) external returns (bool success);
    function transfer(address to, uint tokens) external returns (bool success);
    function balanceOf(address account) external view returns (uint256);
}

contract StakingContract is Ownable{
    //vars
    address StakingToken;
    uint256 currentID = 0;
    bool public StakingEnabled = false;

    struct Stake { 
        //address of staker
        address owner;
        //amount staked without decimals (*10^18)
        uint256 amount;
        //stake block timestamp
        uint256 EventTime;
        //stake (0) or unstake (1)
        uint8 eventType;
    }   
    //event id (autoincrement) => staking info
    mapping(uint256=>Stake) StakingHistory;
    //address => amount staked
    mapping(address=>uint256) StakingBalances;

    //fallbacks
    receive() external payable {}
    fallback() external payable {}

    //events
    event NewStake(address staker, uint256 id, Stake stake, uint256 blockTime);
    event Unstake(address staker, uint256 id, Stake stake, uint256 blockTime);

    function SetStakingToken(address _token) public onlyOwner {
        StakingToken = _token;
    }

    function ToggleStaking() public onlyOwner{
        StakingEnabled = !StakingEnabled;
    }

    // enter amount * (10^18) to allow for decimals
    function StakeToken(uint256 amount) public {
        require(StakingEnabled, "Staking Is Not Enabled");
        require(StakingBalances[msg.sender] + amount >= 1000000*10**18, "ERROR: MAXIMUM STAKE"); //less than 1 million
        require(StakingBalances[msg.sender] + amount <= 10*10**18, "ERROR: MINIMUM STAKE"); // more than 10
        require (ERC20(StakingToken).balanceOf(msg.sender) >= amount, "ERROR: INSUFFICIENT BALANCE");

        ERC20(StakingToken).transferFrom(msg.sender, address(this), amount);
        StakingBalances[msg.sender] += amount;
        Stake memory newStake = Stake(msg.sender,amount, block.timestamp, 0);
        StakingHistory[currentID+1] = newStake;
        emit NewStake(msg.sender, currentID+1, newStake, block.timestamp);
        currentID+=1;
    }

    // enter amount * (10^18) to allow for decimals
    function UnstakeToken(uint256 amount) public {
        require(StakingBalances[msg.sender] <= amount, "ERROR: INSUFFICIENT BALANCE"); //less than 1 million

        ERC20(StakingToken).transfer(msg.sender, amount);
        StakingBalances[msg.sender] -= amount;
        Stake memory newUnstake = Stake(msg.sender,amount, block.timestamp, 1);
        StakingHistory[currentID+1] = newUnstake;
        emit Unstake(msg.sender, currentID+1, newUnstake, block.timestamp);
        currentID+=1;
    }

    // function createProperty() public payable returns(uint256) {
    //     require(msg.value >= 0.1 ether, "NEED 0.1 ETHER");
    //     Property memory newProp = Property(currentID+1, msg.sender, msg.sender, 0, 0, true);
    //     propertiesListed[currentID+1] = newProp;
    //     currentID+=1;
    //     emit NewProperty(newProp, block.timestamp);
    //     return currentID;
    // }

    // //_id refers to the property id
    // function delistProperty(uint256 _id) public {
    //     require(propertiesListed[_id].owner == msg.sender, "NOT OWNER");
    //     require(propertiesListed[_id].checkOut < block.timestamp, "CANNOT DELIST WHILE BOOKED");
    //     propertiesListed[_id].listed = false;
    //     emit Delisted(propertiesListed[_id], block.timestamp);
    // }

    // //_id refers to the property id
    // function relistProperty(uint256 _id) public {
    //     require(propertiesListed[_id].owner == msg.sender, "NOT OWNER");
    //     require(!propertiesListed[_id].listed, "NOT DELISTED");
    //     propertiesListed[_id].listed = true;
    //     emit Relisted(propertiesListed[_id], block.timestamp);
    // }

    // //_id refers to the property id
    // //_renter is the person who will be renting
    // //_days is the number of days to book for
    // function bookProperty(uint256 _id, address _renter, uint256 _days) public {
    //     require(propertiesListed[_id].checkOut < block.timestamp, "ALREADY BOOKED");
    //     //Also makes sure listing exists, non existent = false
    //     require(propertiesListed[_id].listed, "DELISTED");
    //     require(_days > 0);

    //     propertiesListed[_id].checkIn = block.timestamp;
    //     propertiesListed[_id].checkOut = block.timestamp + _days * 1 days;
    //     propertiesListed[_id].renter = _renter;
    //     emit BookedProperty(propertiesListed[_id], block.timestamp);
    // }
}

